import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  BeakerIcon, 
  CalendarIcon, 
  ChartBarIcon, 
  ClockIcon, 
  CubeIcon, 
  PlusIcon,
  ArrowUpIcon,
  ArrowDownIcon
} from '@heroicons/react/outline';
import { useAuth } from '../../contexts/AuthContext';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

interface CardProps {
  title: string;
  value: string | number;
  change?: number;
  icon: React.ReactNode;
  iconColor: string;
  to: string;
}

const StatCard: React.FC<CardProps> = ({ title, value, change, icon, iconColor, to }) => (
  <Link 
    to={to}
    className="bg-white overflow-hidden shadow rounded-lg transition-transform hover:transform hover:scale-105"
  >
    <div className="p-5">
      <div className="flex items-center">
        <div className={`flex-shrink-0 ${iconColor} rounded-md p-3`}>
          {icon}
        </div>
        <div className="ml-5 w-0 flex-1">
          <dl>
            <dt className="text-sm font-medium text-gray-500 truncate">
              {title}
            </dt>
            <dd>
              <div className="text-lg font-medium text-gray-900">
                {value}
              </div>
            </dd>
          </dl>
        </div>
      </div>
    </div>
    {change !== undefined && (
      <div className="bg-gray-50 px-5 py-3">
        <div className="text-sm">
          <div className="flex items-center">
            {change > 0 ? (
              <ArrowUpIcon className="w-4 h-4 text-green-500 mr-1" />
            ) : change < 0 ? (
              <ArrowDownIcon className="w-4 h-4 text-red-500 mr-1" />
            ) : null}
            <span
              className={change > 0 ? 'text-green-500' : change < 0 ? 'text-red-500' : 'text-gray-500'}
            >
              {Math.abs(change)}% {change > 0 ? 'increase' : change < 0 ? 'decrease' : 'no change'} from last month
            </span>
          </div>
        </div>
      </div>
    )}
  </Link>
);

const Dashboard: React.FC = () => {
  const { user } = useAuth();
  const [loading, setLoading] = useState(true);
  const [dashboardData, setDashboardData] = useState({
    testCount: 0,
    nextTestDate: new Date().toISOString(),
    recentTestResults: [],
    recommendations: [],
    wearableStats: {
      avgHeartRate: 0,
      avgSleep: 0,
      avgSteps: 0
    }
  });

  // Fetch dashboard data
  useEffect(() => {
    // This would normally fetch data from the API
    // For now, we'll use mock data
    setTimeout(() => {
      setDashboardData({
        testCount: 12,
        nextTestDate: new Date(Date.now() + 7 * 24 * 60 * 60 * 1000).toISOString(), // 7 days from now
        recentTestResults: [
          { id: '1', name: 'Complete Blood Count', date: '2023-05-15', provider: 'LabCorp', abnormalCount: 2 },
          { id: '2', name: 'Lipid Panel', date: '2023-04-10', provider: 'Quest', abnormalCount: 1 },
          { id: '3', name: 'Thyroid Panel', date: '2023-03-22', provider: 'LabCorp', abnormalCount: 0 }
        ],
        recommendations: [
          { id: '1', name: 'Vitamin D', reason: 'Low vitamin D levels', priority: 'High' },
          { id: '2', name: 'Omega-3', reason: 'Improve cholesterol levels', priority: 'Medium' },
          { id: '3', name: 'Magnesium', reason: 'Support sleep quality', priority: 'Medium' }
        ],
        wearableStats: {
          avgHeartRate: 68,
          avgSleep: 7.2,
          avgSteps: 8500
        }
      });
      setLoading(false);
    }, 1000);
  }, []);

  // Mock chart data for heart rate over time
  const heartRateData = {
    labels: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'],
    datasets: [
      {
        label: 'Heart Rate (bpm)',
        data: [65, 68, 70, 72, 67, 63, 64],
        fill: false,
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }
    ]
  };

  // Mock chart data for sleep over time
  const sleepData = {
    labels: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'],
    datasets: [
      {
        label: 'Sleep (hours)',
        data: [7.5, 6.8, 7.2, 8.0, 6.5, 7.8, 8.2],
        fill: false,
        borderColor: 'rgb(153, 102, 255)',
        tension: 0.1
      }
    ]
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top' as const,
      },
      title: {
        display: false
      }
    },
    scales: {
      y: {
        beginAtZero: false
      }
    }
  };

  if (loading) {
    return (
      <div className="flex h-96 items-center justify-center">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Page header with responsive layout */}
      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between gap-4">
        <h1 className="text-2xl font-semibold text-gray-900">Dashboard</h1>
        <Link 
          to="/lab-tests/upload"
          className="inline-flex items-center justify-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-blue-600 hover:bg-blue-700 focus:outline-none w-full sm:w-auto"
        >
          <PlusIcon className="h-5 w-5 mr-2" />
          Upload Lab Test
        </Link>
      </div>

      {/* Summary Cards - Responsive grid */}
      <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-3">
        <StatCard
          title="Total Lab Tests"
          value={dashboardData.testCount}
          change={8}
          icon={<BeakerIcon className="h-6 w-6 text-white" />}
          iconColor="bg-blue-500"
          to="/lab-tests"
        />
        <StatCard
          title="Next Test Due"
          value={new Date(dashboardData.nextTestDate).toLocaleDateString()}
          icon={<CalendarIcon className="h-6 w-6 text-white" />}
          iconColor="bg-green-500"
          to="/lab-tests/schedule"
        />
        <StatCard
          title="Active Supplements"
          value={dashboardData.recommendations.length}
          change={-5}
          icon={<CubeIcon className="h-6 w-6 text-white" />}
          iconColor="bg-purple-500"
          to="/supplements"
        />
      </div>

      {/* Content sections with responsive layouts */}
      <div className="grid grid-cols-1 gap-6 lg:grid-cols-2">
        {/* Recent Lab Tests */}
        <div className="bg-white shadow rounded-lg overflow-hidden">
          <div className="px-4 py-5 sm:px-6 border-b border-gray-200 flex justify-between items-center">
            <h3 className="text-lg font-medium text-gray-900">Recent Lab Tests</h3>
            <Link to="/lab-tests" className="text-sm font-medium text-blue-600 hover:text-blue-500">
              View all
            </Link>
          </div>
          <div className="px-4 sm:px-6 py-5">
            <ul className="divide-y divide-gray-200">
              {dashboardData.recentTestResults.map((test) => (
                <li key={test.id} className="py-4">
                  <div className="flex items-center justify-between">
                    <div className="flex-1 min-w-0">
                      <p className="text-sm font-medium text-gray-900 truncate">
                        {test.name}
                      </p>
                      <div className="flex items-center text-xs text-gray-500 mt-1">
                        <ClockIcon className="flex-shrink-0 mr-1.5 h-4 w-4 text-gray-400" />
                        <span>{new Date(test.date).toLocaleDateString()}</span>
                        <span className="mx-2">•</span>
                        <span>{test.provider}</span>
                      </div>
                    </div>
                    <div className="flex-shrink-0 ml-5">
                      {test.abnormalCount > 0 ? (
                        <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-red-100 text-red-800">
                          {test.abnormalCount} abnormal
                        </span>
                      ) : (
                        <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-green-100 text-green-800">
                          Normal
                        </span>
                      )}
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Recommendations */}
        <div className="bg-white shadow rounded-lg overflow-hidden">
          <div className="px-4 py-5 sm:px-6 border-b border-gray-200 flex justify-between items-center">
            <h3 className="text-lg font-medium text-gray-900">Current Recommendations</h3>
            <Link to="/recommendations" className="text-sm font-medium text-blue-600 hover:text-blue-500">
              View all
            </Link>
          </div>
          <div className="px-4 sm:px-6 py-5">
            <ul className="divide-y divide-gray-200">
              {dashboardData.recommendations.map((recommendation) => (
                <li key={recommendation.id} className="py-4">
                  <div className="flex items-center justify-between">
                    <div className="flex-1 min-w-0">
                      <p className="text-sm font-medium text-gray-900 truncate">
                        {recommendation.name}
                      </p>
                      <p className="text-xs text-gray-500 mt-1">
                        {recommendation.reason}
                      </p>
                    </div>
                    <div className="flex-shrink-0 ml-5">
                      <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${
                        recommendation.priority === 'High' 
                          ? 'bg-red-100 text-red-800' 
                          : recommendation.priority === 'Medium'
                            ? 'bg-yellow-100 text-yellow-800'
                            : 'bg-blue-100 text-blue-800'
                      }`}>
                        {recommendation.priority}
                      </span>
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>

      {/* Wearable charts */}
      <div className="bg-white shadow rounded-lg overflow-hidden">
        <div className="px-4 py-5 sm:px-6 border-b border-gray-200">
          <h3 className="text-lg font-medium text-gray-900">Wearable Health Data</h3>
          <p className="mt-1 text-sm text-gray-500">
            Weekly trends from your connected devices
          </p>
        </div>
        <div className="p-4 sm:p-6">
          <div className="grid grid-cols-1 gap-6 md:grid-cols-2">
            <div className="h-80 md:h-72 flex flex-col">
              <h4 className="text-sm font-medium text-gray-500 mb-2">Heart Rate (avg: {dashboardData.wearableStats.avgHeartRate} bpm)</h4>
              <div className="flex-1 w-full">
                <Line data={heartRateData} options={chartOptions} />
              </div>
            </div>
            <div className="h-80 md:h-72 flex flex-col">
              <h4 className="text-sm font-medium text-gray-500 mb-2">Sleep Duration (avg: {dashboardData.wearableStats.avgSleep} hrs)</h4>
              <div className="flex-1 w-full">
                <Line data={sleepData} options={chartOptions} />
              </div>
            </div>
          </div>
        </div>
        <div className="bg-gray-50 px-4 py-4 sm:px-6 border-t border-gray-200">
          <div className="flex justify-between items-center">
            <span className="text-sm text-gray-500">
              Last synced: Today, 8:42 AM
            </span>
            <Link 
              to="/wearables" 
              className="inline-flex items-center text-sm font-medium text-blue-600 hover:text-blue-500"
            >
              View detailed stats
              <svg className="ml-1 h-5 w-5 text-blue-500" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                <path fillRule="evenodd" d="M7.293 14.707a1 1 0 010-1.414L10.586 10 7.293 6.707a1 1 0 011.414-1.414l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414 0z" clipRule="evenodd" />
              </svg>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
